  true,\n\t\"url\": null,\n\t\"notes\": \"This raw data reflects readings from instruments
  mounted on or near a 82 meter meteorological tower located at the [National Wind
  Technology Center (NWTC)](http://www.nrel.gov/wind/ \"NWTC website\"), approximately
  5 miles south of Boulder, CO (specifically: 39.9107 N, 105.2348 W, datum WGS84).
  The base elevation at the site is 1,855 meters AMSL.rnrnThe dataset includes irrandiance
  information (Global, kWs/m2) and meteorological data, such as temperature, pressure,
  and dew point, as well as wind speed and direction at 2m, 5m, 10m, 20m, 50m, and
  80m. Included here is a portion of the available data: from September 23, 1996 -
  August 23, 2001. A separate dataset is available for [Aug 24, 2001 - March 10, 2011](http://en.openei.org/datasets/dataset/raw_data_from_national_wind_technology_center_m2_tower__2001_-_2011_
  \"OpenEI dataset 2001 - 2011\") in OpenEI. The [NWTC website](http://www.nrel.gov/midc/nwtc_m2/
  \"Website for M2 Tower data\") provides current data (updated daily), from as early
  as August 24, 2001, as well as [instrument specifications](http://www.nrel.gov/midc/nwtc_m2/
  \"NWTC M2 Instrument Descriptions\").\",\n\t\"license_title\": \"Creative Commons
